import { NavLink } from "react-router-dom";

function NavBar() {
  return (
    <div>NavBar
        <NavLink
            to="/"
            exact
            className="active item"
            activeStyle={{
                background: "#E6E6E8",
            }}
        >
        </NavLink>
        <NavBar
            to="/AddRecipe"
            exact
            className="item"
            activeStyle={{
              background: "#E6E6E8",
            }}
        >

        </NavBar>

    </div>
  )
}

export default NavBar
